import "./Contact.css";

export default function Contact() {
	return (
		<div className="container-contact">
			<div className="info-contact"></div>
			<h1>Contacter-nous</h1>
			<p>Par mail : blog@mail.com</p>
			<p>Par telephone : xx xx xx xx xx</p>
			<p>Rejoingner nous sur les reseaux</p>
			<ul>
				<li>Facebook</li>
				<li>Instagram</li>
				<li>Twitter</li>
			</ul>
		</div>
	);
}
